import React from 'react';
import { useParams } from 'react-router-dom';
import GalleryView from '../components/Gallery/GalleryView';

const ShareGalleryPage = () => {
  const { token } = useParams();

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-black to-gray-800">
      {/* Header */}
      <header className="bg-black/20 backdrop-blur-md border-b border-white/10">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-center items-center h-16">
            <h1 className="text-2xl font-serif font-bold bg-gradient-to-r from-white to-gray-300 bg-clip-text text-transparent">
              Gallery Pavilion
            </h1>
          </div>
        </div>
      </header>

      {/* Gallery Content */}
      <main className="w-full">
        <GalleryView galleryId={token} isSharedView={true} />
      </main>
    </div>
  );
};

export default ShareGalleryPage;
